import React, { Component } from "react";

export default class Routing extends Component {
  render() {
    return (
      <div class="wrapper">
        <Header />
        {/*{location.pathname === "/login" ? null : <Header />}*/}
        <Menu />
        <Router>
          <Routes>
            <Route path="/login" element={<Loginpage />} />
            <Route path="/" exact element={<Dashboard />} />
          </Routes>
        </Router>
        <Footer />
      </div>
    );
  }
}
